import Footer from "../components/Footer";

export default {
  component : Footer,
  title : 'Footer',
  argTypes : {}
}

const Template = args => <Footer {...args} />

export const Default = Template.bind({})
Default.args = {
  data : [1,2,3]
}


export const List1 = Template.bind({})
List1.args = {
  data : ['한줄처리']
}

export const noData = Template.bind({})
noData.args = {
  data : null
}
